import React from "react";
import ListItem from "./ListItem";

function Slytherin({id, names, handleRemove}){

  console.log("(S) Students: ", name)

  return(
    <div>
      <header>
        Slytherin Students
      </header>
      {<ListItem 
        key={id}
        student_name={names}
        onRemove={handleRemove}
      /> }
    </div>
  )
}

export default Slytherin;
